// define a function that takes a string of 'croak' sounds made by frogs and returns the minimum number of frogs needed to make the sounds
function f_gold(croakOfFrogs) {
    // initialize counters for each letter in 'croak'
    let c = 0, r = 0, o = 0, a = 0, k = 0, ans = 0;
    // iterate through each character in the input string
    for (let ch of croakOfFrogs) {
        // increment the counter for the corresponding letter
        if (ch == 'c') {
            c += 1;
            // if there are any 'k' sounds waiting, use one to complete a 'croak'
            if (k > 0) {
                k -= 1;
            }
            // otherwise, increment the count of completed 'croaks'
            else {
                ans += 1;
            }
        }
        else if (ch == 'r') {
            r += 1;
            c -= 1;
        }
        else if (ch == 'o') {
            o += 1;
            r -= 1;
        }
        else if (ch == 'a') {
            a += 1;
            o -= 1;
        }
        else {
            k += 1;
            a -= 1;
        }
        // if any counter becomes negative, it means the 'croak' sequence is invalid, so return -1
        if (c < 0 || r < 0 || o < 0 || a < 0) {
            return -1;
        }
    }
    // if any counter is non-zero, it means the 'croak' sequence is incomplete, so return -1
    return (c != 0 || r != 0 || o != 0 || a != 0) ? -1 : ans;
}
